import React from 'react';
import './App.css';

class Home extends React.Component {
    render() {
      const user = undefined;
      return (
        <div>
          <div>
            <h1>Home</h1>
            {this.props.news}
            <button type="button" onClick={() => console.log(user.email)}>
              Test Sentry
            </button>
            <a href={'embbeded_test.html'}> Test Embedded</a>
          </div>
        </div>
      );
    }
  }
  
  export default Home;
